import React from 'react';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import NavDropdown from 'react-bootstrap/NavDropdown';
import { Link } from 'react-router-dom';

function Menu() {
  return (
    <Navbar expand="lg" className='p-3'>
      <Navbar.Brand as={Link} to="/">SW Experience</Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="me-auto">
          <Nav.Link as={Link} to="/">Home</Nav.Link>
          <Nav.Link as={Link} to="/about">About</Nav.Link>
          <Nav.Link as={Link} to="/contact">Contact</Nav.Link>
          <NavDropdown title="Destinations" id="basic-nav-dropdown">
            <NavDropdown.Item as={Link} to="/action/3.1">Canada</NavDropdown.Item>
            <NavDropdown.Item as={Link} to="/action/3.2">Spain</NavDropdown.Item>
            <NavDropdown.Item as={Link} to="/action/3.3">England</NavDropdown.Item>
          </NavDropdown>
        </Nav>
        <Nav className="d-lg-flex">
          <Nav.Link as={Link} to="/">Right Link 1</Nav.Link>
          <Nav.Link as={Link} to="/">Right Link 2</Nav.Link>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
}

export default Menu;
